css:
.hhvm-toolbar {
  display: flex;
}
.hhvm-toolbar-icon-container {
  width: 100%;
  height: 100%;
  display: flex;
  text-align: center;
  justify-content: center;
}
.hhvm-icon polygon {
  fill: #a3a8ae;
}
.nuclide-hhvm-task-runner-icon {
  display: flex;
}
.nuclide-hhvm-use-terminal-control {
  left: '10px';
}
.nuclide-hhvm-toolbar-settings {
  display: flex;
  flex: 1;
  justify-content: flex-end;
  padding-top: 10px;
  position: relative;
  right: 10px;
  bottom: 10px;
}
